import React from 'react';

const Speakers = () => {

    return (
        <div>
            {
                speakers.map(({imgSrc, name}) => {
                    return <img src={`/images/  ${imgSrc}`} key={imgSrc} alt={name}/>;
                })
            }
        </div>
    );
}

const EnhancedSpeakerComponent = withData(Speakers);

function withData(Component){
    const speakers = [
        {
            imgSrc: 'speaker-component-1124.png',
            name: 'Douglas'
        },
        {
            imgSrc: 'speaker-component-1530.png',
            name: 'Tamara'
        },
        {
            imgSrc: 'speaker-component-10803.png',
            name: 'Eugene'
        }
    ];
    return function() {
        return <Component></Component>
    };
}

export default EnhancedSpeakerComponent;
